import React from 'react'
import { Button, Form, Row } from 'react-bootstrap'

import data from '../Utils/data'

const Home = () => {
  return (
    <div>
      {
        <Form>
          {data.map((item) => (
            <Row key={item.id}>
              <Form.Label as='button'>{item.question}</Form.Label>
              <Form.Text as='span'>{item.answer}</Form.Text>
            </Row>
          ))}
          <Button variant='primary' type='submit'>
            Submit
          </Button>
        </Form>
      }
    </div>
  )
}

export default Home
